import { Box, Container, Typography } from "@mui/material";

const Home = () => {
  return (
    <>
      <Box sx={{ width: "100%", boxSizing: "border-box" }}>
        <Box p={2} minHeight={500}></Box>

        <Box p={2} minHeight={500} bgcolor="#f5f5f5"></Box>
      </Box>
    </>
  );
};

export default Home;
